import React from 'react';

const InfoSection = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-around', padding: '20px', backgroundColor: '#f5f5f5' }}>
      <div style={{ flex: 1, margin: '0 10px' }}>
        <h2>About the Company</h2>
        <p>
          We are a leading consultancy company dedicated to providing expert advice and innovative solutions to help businesses grow and succeed in a competitive market.
        </p>
      </div>
      <div style={{ flex: 1, margin: '0 10px' }}>
        <h2>Our Featured Services</h2>
        <p>
          Strategy consulting, operational improvement, technology integration, and management advisory services tailored to meet your unique business needs.
        </p>
      </div>
      <div style={{ flex: 1, margin: '0 10px' }}>
        <h2>Our Featured Products</h2>
        <p>
          Innovative software tools, analytics platforms, and custom solutions designed to enhance productivity and drive business success.
        </p>
      </div>
    </div>
  );
};

export default InfoSection;
